import React, { useState } from "react";

const Nav = () => {
    const [ window, setWindow ] = useState(false);

    let openClose = ({ }) => {
        if(window === false) {
            setWindow(true);
        } else {
            setWindow(false);
        }
    };

    return (
        <div className="bg-blue-100 w-full h-11 navbar-menu" style={{ width: window === false ? 250 : 60 }}> 
            <div className="burger" onClick={() => openClose()}>
                <span class="material-symbols-outlined">
                    menu
                </span>
            </div>
            <ul>
                {li.map((item, i) => (
                    <div key={i}>
                        <li
                            style={{ display: window === false ? "inline-block" : "none" }}
                        >
                            {item[0]}
                        </li>
                    </div>
                ))}
            </ul>
        </div>
    );
}

export default Nav;
